import React from 'react'
import { Link } from 'react-router-dom'

const ListTicket = ({booking}) => {
  return (
    <Link to={`/profile/${booking.id}`}>
        <div className='ticketItem'>
            <div></div>
        </div>
    </Link>
  )
}

export default ListTicket
